    private function addHall($restaurantId, $titleColumn, $sizeColumn)
    {
        if ($titleColumn && $sizeColumn) {
            $hall = new RestaurantHall();
            $hall->restaurant_id = $restaurantId;
            $hall->title = $titleColumn;
            $hall->size = (integer)$sizeColumn;
            $hall->save();
        }
    }

    private function addMetro($restaurantId, $metroColumn)
    {
        if ($metroColumn) {
            $metro = new OrganizationLinkMetro();
            $metro->organization_id = $restaurantId;
            $metro->metro_id = $this->getMetro()[$metroColumn];
            $metro->save();
        }
    }


    /**
     * @return array [[restogram_id => local_id], ...]
     */
    private function getMetro()
    {
        if ($this->_metro) {
            return $this->_metro;
        }
        $import = json_decode(file_get_contents(__DIR__ . '/metro.json'), true);
        foreach ($import as $metroArray) {

            $localMetro = Metro::find()->where(['title' => $metroArray['name']])->one();
            if (!$localMetro) {
                $localMetro = new Metro(['title' => $metroArray['name'], 'line_id' => 1]);
                $localMetro->save();
            }
            $this->_metro[$metroArray['_id']['$oid']] = $localMetro->id;
        }
        return $this->_metro;
    }


